import "./ConsulElimiPlanTrabajo.css"
//import imagenUsuario from '../imagenes/usuario.png';
import { NavLink, useNavigate } from "react-router-dom";


function ConsulElimiPlanTrabajo(){

  const navigate = useNavigate(); 

  function Volver (){
    navigate('/MenuPlanTrabajo');

  }
  function funcionEditarPlanT (){
    navigate('/EditarPlanTrabajo');

  }
  function funcionEliminarPlanT (){
    navigate('/MenuPrincipal');

  }

  //style={{backgroundImage: `url(${imagenUsuario})`, backgroundSize: 'cover', backgroundRepeat: 'no-repeat'}}

  return(
    <div>
      <label className="barraConsulElimiPlanTrabajo"> </label>
      <label className="nombreUsuarioConsulElimiPlanTrabajo"> Nombre Usuario </label>
      <label className="planTrabajoConsulElimiPlanTrabajo"> Plan de Trabajo </label>

      <label className="nombrePlanConsulElimiPlanTrabajo"> *NOMBRE PLAN DE TRABAJO* </label>
      <label className="responsableConsulElimiPlanTrabajo"> *NOMBRE DEL RESPONSABLE DEL PLAN DE TRABAJO* </label>

      <div className="todasActividadesConsulElimiPlanTrabajo" style={{ height: "320px", overflow: "auto" }}> 

      </div>

      <button onClick={funcionEditarPlanT} className="botonEditarPlanConsulElimiPlanTrabajo"> Editar plan de trabajo </button>
      <button onClick={funcionEliminarPlanT} className="botonEliminarPlanConsulElimiPlanTrabajo"> Eliminar plan de trabajo </button>

      <button className="botonPersonaConsulElimiPlanTrabajo">  </button>
      <button onClick={Volver} className="botonVolverConsulElimiPlanTrabajo"> Volver </button>

    </div>


  )
}

export default ConsulElimiPlanTrabajo;
